export default function FifthPage() {
    return (
        <div class="fifthpage_container" id="service">
            <h2>PRICE LIST</h2>
            <p>Our pricing plan comes with various membership tiers, each tailored to </p>
            <p>cater to different preferences and fitness aspirations.</p>
        </div>
    )
}
